import './App.css';
import React from 'react';
import TextField from '@material-ui/core';

// TextField Name Component
function RowName() {
    return (
        <div className="rowName">
            <label>Name</label>
            <TextField
                className="inputName"
                id="outlined-basic"
                variant="outlined"
                size="small"
                value={name}
            />
        </div>
    );
}

export default RowName;
